13.body:
The iso live installer comes preconfigured with a network configuration which announces it's hostname via MulticastDNS as hostname.local, that is NixOS.local in the above example. In the rare case that MulticastDNS is not availabe or turned off in your network, there is a static link-local IPv6 address configured to fe80::47(mnemonic from the letter's position in the english alphabet: n=14 i=9 x=24; 47 = n+i+x). Provided that you have added your public key to the authorized keys of the nixos user: { ... }:
{ users.users.nixos.openssh.authorizedKeys.keyFiles = [ ../secrets/path/to/key.pub ];
} You can then ssh into the live installer through one of the following options: ssh nixos@NixOS.local ssh nixos@fe80::47%eno1 # where eno1 is your network interface on which you are linked to the target Note: the static link-local IPv6 address and MulticastDNS is only configured on the live installer. If you wish to enable MulticastDNS for your environment, you ought to configure that in a regular profile .

