pkgs/development/libraries/libinih/default.nix: { stdenv, meson, ninja, lib, srcs, ... }:
let inherit (srcs) libinih; in
stdenv.mkDerivation { pname = "libinih"; # version will resolve to 53, as specified in the final example below inherit (libinih) version; src = libinih; buildInputs = [ meson ninja ]; # ...
} pkgs/default.nix: final: prev: { libinih = prev.callPackage ./development/libraries/libinih { };
} pkgs/flake.nix: { description = "Package sources"; inputs = { libinih.url = "github:benhoyt/inih/r53"; libinih.flake = false; };
}

